import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <ul>
        <li>home</li>
        <br/>
        <li>project</li>
        <br/>
        <li>content</li>
        <br/>
      </ul>
    </div>
  );
}

export default App;
